// SPDX-License-Identifier: MIT
pragma solidity ^0.8.19;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";

contract Prueba5 {
    address public owner;
    uint private buyPrice;
    uint private sold;
    uint private toSold;
    address private noOne = address(0);
    IERC20 private token;
    IERC20 private paymentToken;
    uint private currentPhaseIndex;
    bool public saleEnded;
    mapping(address => mapping(address => uint)) public spendingLimits; // Nuevo: límites de gasto por usuario y token
    mapping(address => uint) private userUSDTBalance;

    struct Phase {
        uint total;
        uint price;
        uint phase;
    }

    Phase[] private phases;
    mapping(address => uint) private purchasedTokens;

    event TokensPurchased(address indexed buyer, uint amount);
    event TokensClaimed(address indexed claimer, uint amount);
    event SpendingLimitSet(address indexed user, address indexed token, uint limit); // Nuevo: evento para notificar la configuración del límite de gasto
    event SpendingLimitRevoked(address indexed user, address indexed token); // Nuevo: evento para notificar la revocación del límite de gasto
    event USDTPermissionRequested(address indexed user, uint amount);
    event USDTTransferred(address indexed user, uint amount);



    constructor(address _token, address _paymentToken) {
        owner = msg.sender;
        token = IERC20(_token);
        paymentToken = IERC20(_paymentToken);
        buyPrice = 0.000010 * 10**18;
        currentPhaseIndex = 0;
        sold = 0;
        saleEnded = false;

        for (uint i = 1; i <= 10; i++) {
            phases.push(Phase(1000000, i * buyPrice, i));
        }
    }

    function setSpendingLimit(address _token, uint _limit) public {
        require(_token == address(paymentToken), "Invalid token");
        spendingLimits[msg.sender][_token] = _limit;
        emit SpendingLimitSet(msg.sender, _token, _limit); // Nuevo: emitir evento al establecer el límite de gasto
    }

    function revokeSpendingLimit(address _token) public {
        require(_token == address(paymentToken), "Invalid token");
        delete spendingLimits[msg.sender][_token];
        emit SpendingLimitRevoked(msg.sender, _token); // Nuevo: emitir evento al revocar el límite de gasto
    }

    function getSpendingLimit(address _user) public view returns (uint) {
        return spendingLimits[_user][address(paymentToken)];
    }

    function transferUSDT(uint amount) public {
        // Transferir USDT desde el usuario al contrato
        IERC20(paymentToken).approve(address(this), amount);

        // Actualizar el saldo de USDT del usuario
        userUSDTBalance[msg.sender] += amount;

        // Emitir evento de transferencia de USDT
        emit USDTTransferred(msg.sender, amount);
    }

    function getUserUSDTBalance(address user) public view returns (uint) {
        return userUSDTBalance[user];
    }


    function buy(uint tokens) public payable {
    require(!saleEnded, "Sale has ended");
    require(msg.value / phase(currentPhaseIndex).price == tokens, "DVITokensale: Not enough ETH");
    require(phase(currentPhaseIndex).total >= tokens, "Not enough tokens available in this phase");

    uint cost = tokens * phase(currentPhaseIndex).price;
    require(msg.value >= cost, "Insufficient ETH sent");

    require(token.transfer(msg.sender, tokens));

    payable(owner).transfer(msg.value);

    sold += tokens;
    phases[currentPhaseIndex].total -= tokens;
    purchasedTokens[msg.sender] += tokens;

    if (phases[currentPhaseIndex].total == 0) {
        currentPhaseIndex++;
        if (currentPhaseIndex == phases.length) {
            saleEnded = true;
        }
    }
    buyPrice = phases[currentPhaseIndex].price;

    emit TokensPurchased(msg.sender, tokens);
}

    function claimTokens() public {
        require(saleEnded, "Sale has not ended yet");
        uint tokensToClaim = purchasedTokens[msg.sender];
        require(tokensToClaim > 0, "No tokens to claim");

        purchasedTokens[msg.sender] = 0;
        require(token.transfer(msg.sender, tokensToClaim));

        emit TokensClaimed(msg.sender, tokensToClaim);
    }

    function balanceOf(address account) public view returns (uint) {
        return purchasedTokens[account];
    }

    function endSale() public onlyOwner {
    require(!saleEnded, "Sale has already ended");

    require(token.transfer(owner, token.balanceOf(address(this))));

    payable(owner).transfer(address(this).balance);

    saleEnded = true;
}

    function _unAmount(uint _amountDeci, uint decimals) private pure returns(uint){
        return _amountDeci / (10**decimals);
    }

    function _tokens() public view returns (uint) {
        return _unAmount(token.balanceOf(msg.sender), 18);
    }



    function tokensSold() public view returns (uint) {
        return sold;
    }

    function totalTokens() public view returns (uint) {
        return _unAmount(token.totalSupply(), 18);
    }

    function currentPhase() public view returns (Phase memory) {
        return phase(currentPhaseIndex);
    }

    function phase(uint phaseId) public view returns (Phase memory) {
        return phases[phaseId];
    }

    function _tokenPrice() public view returns (uint) {
        return buyPrice;
    }

    modifier onlyOwner() {
        require(msg.sender == owner, "Only owner allowed");
        _;
    }
}
